import React from 'react'
import Issue from './Issue.js'

export default function IssueList(props){
    const { issues, deleteIssue, likeIssue } = props
    return (
        <div className='issue-list'>
            { issues.map(issue => <Issue {...issue} likeIssue={likeIssue} deleteIssue={deleteIssue} id={issue._id} key={issue._id}/>)}
        </div>
    )
}
